pragma solidity ^0.6.1;
pragma experimental ABIEncoderV2;
contract TestLurien{
    
    //Contract used from the university service
    address serviceAddress;
    address userAddress;
    bool consent;

    string[] public claim;
    
    constructor()public{
        serviceAddress = msg.sender;
        claim.push("dni");
        claim.push("name");
        claim.push("accessTestCertificate");
        claim.push("accessTestMark");
    }
    
    function getClaim()public view returns(string[] memory){
        return claim;
    }
    
    event ClaimFilled(
        string _filledClaim
    );

    function claimFilled(string memory _claimJson) public {
        // Events are emitted using `emit`, followed by
        // the name of the event and the arguments
        // (if any) in parentheses. Any such invocation
        // (even deeply nested) can be detected from
        // the JavaScript API by filtering for `Deposit`.
        
        userAddress = msg.sender;
        
        emit ClaimFilled(_claimJson);
    }
    
}
